import React from 'react';
import { ContainerBase } from '../../style';
import { ContainerAction, ContainerPage } from './style';

export default function ThridPage() {

    const randomDog = ()=>{
        return 'https://random.dog/'
    }

 return (
    <ContainerBase>
        <ContainerPage>
            <div>
                <img src={randomDog}/>
            </div>
        </ContainerPage>
        <ContainerAction>
            <button>Atualizar</button>
            <button>Avancar</button>
        </ContainerAction>
    </ContainerBase>
 )
}
